# Rassvet, Iglinsky District, Republic of Bashkortostan

}}
Rassvet () is a rural locality (a village) in Krasnovoskhodsky Selsoviet, Iglinsky District, Bashkortostan, Russia. The population was 14 as of 2010. There is 1 street.
Geography
Rassvet is located 70 km northeast of Iglino (the district's administrative centre) by road.
